import { withGoogleMap, GoogleMap, Marker } from 'react-google-maps';



const Map = withGoogleMap(props => (
    <GoogleMap
        defaultCenter={{ lat: props.lat, lng: props.lng }}
        defaultZoom={15}
    >
        <Marker position={{ lat: props.lat, lng: props.lng }} />
    </GoogleMap>
));
